import React, { Component } from 'react';
import './Home.css';
import Home from './Home.js';
import Nav from './Nav.js';
import History from './History.js';
import Clock from './Clock.js';
import moment from 'moment';


class App extends Component {
  render() {
    return (
      <div>
        <Nav/>
        <Home />
        <History />
        <Clock />
      </div>
    );
  }
}


export default App;
